@theproteinworks can I make a suggestion? Could you start making your protein shake scoops transparent? I'd hate to not get a full scoops worth! 😉
It's not always obvious if the scoop is full of the powder when you can't look through to check.
Btw, love the choc peanut cookie dough flavour. First time buying this flavour and I'm not disappointed! #theproteinworks #suggestions
